import React, { useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getTeacherProfile } from '../../actions/profile';
import Spinner from '../layout/Spinner';

const TeacherProfile = ({profile, getTeacherProfile, match}) =>{
  console.log(profile);
  useEffect(()=>{
    getTeacherProfile(match.params.id)
  },[])
  return(
    <>
      {profile == null ? <Spinner/>:
        <>
          <h3>Imię: {profile.name}</h3>
          <h3>Ilość zaproszonych nauczycieli: {profile.invited}</h3>
          <h3>Ilość uczniów: {profile.student}</h3>
          <h3>Ilość klass: {profile.name}</h3>

        </>
      }
    </>
  )
}

TeacherProfile.propTypes = {
}

const mapStateToProps = state => ({
  profile: state.profile.otherProfile
});

export default connect(mapStateToProps, {getTeacherProfile})(TeacherProfile);
